export default function Todo(props) {
    return (
      <div className="todo">
                <p>{props.todo.todo}</p>
                <div>
                  <button className="todo__status">
                    {(props.status) ? "☑" : "☐"}
                  </button>
                </div>
              </div>
    )
  }
